In this torrent, I share a video on how to work on gymnastics backbends, a video on training with sandbags, and a video on neck training and bridging. Just remember to start off slow and take your time in building strength in your bridging. Flexibility is key as well, which takes time to develop. Gradually increase your range of motion in these exercises to build strength in your joints and connective tissues, as well as active flexibility. For more info on sandbag training and other awkward object lifts, check out this post -
